import React, { Component } from 'react';

const MobileMenu = props => {

    return (
      <div className='mobile-menu'>
        <ul>
          <li>About</li>
          <li>Projects</li>
          <li>Contact</li>
        </ul>
      </div>
    );

};

export default MobileMenu;
